// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

contract CreateAccount {
    mapping (address => string) public dataHash;

    mapping (string => mapping (string => address)) public locationTouser;

    function setHash(string memory _ipfsHash) public {
        dataHash[msg.sender] = _ipfsHash;
    }

    function getHash() public view returns (string memory) {
        return dataHash[msg.sender];
    }

    function addLocationToUser(string memory place, address userId, string memory name) public {
        locationTouser[place][name] = userId;
    }

    function returnUserId(string memory place, string memory name) public view returns (address) {
        return locationTouser[place][name];
    } 
}
